    "18: 'temperature_indicator',\n",
    "19: 'flow_indicator',\n",
    "20: 'point_indicator',\n",
    "21: 'equipment_tag_rectangular',\n",
    "22: 'equipment_tag_circular',\n",
    "23: 'equipment_tag_octagonal',\n",
