    "Model Summary\n",
    "The notebook guides you through the process of preparing a custom dataset, configuring the YOLOv8 model, training, and validating the model for object detection tasks. It supports datasets in the YOLO format and is designed to be flexible for different symbol or object classes, as defined in your configuration.\n",
    "\n",
    "Instructions for Using the Model\n",
    "1. Dataset Preparation\n",
    "\n",
    "Organize your images and label files in the YOLO format: each image should have a corresponding .txt label file with bounding box and class information.\n",
    "\n",
    "Split your dataset into train and val sets. Make sure you have train.txt and val.txt listing the image paths for each split.\n",
    "\n",
    "If these files do not exist, the notebook can generate them automatically.\n",
    "\n",
    "2. Dataset Structure Verification\n",
    "\n",
    "The notebook checks for the existence of images, labels, train.txt, and val.txt directories/files.\n",
    "\n",
    "It then organizes your data into the standard YOLOv8 directory structure, separating images and labels for training and validation.\n",
    "\n",
    "3. Class Configuration\n",
    "\n",
    "The notebook scans your label files to determine all unique class IDs present in your dataset.\n",
    "\n",
    "Update the pid_classes dictionary to ensure every class index in your labels has a corresponding class name.\n",
    "\n",
    "The YAML configuration (pid_config.yaml) is generated automatically, listing the number of classes (nc) and their names.\n",
    "\n",
    "Important: The nc value and the length of the names list/dictionary must match the actual number of classes in your dataset.\n",
    "\n",
    "4. Model Training\n",
    "\n",
    "The YOLOv8 model is initialized with pre-trained weights.\n",
    "\n",
    "Training parameters such as number of epochs, image size, batch size, and device are set in the training_params dictionary.\n",
    "\n",
    "Start training by running the training cell. Training progress and logs will be displayed in the notebook.\n",
    "\n",
    "5. Validation and Troubleshooting\n",
    "\n",
    "After training, the model is validated on the validation set.\n",
    "\n",
    "If you see errors like\n",
    "\"Label class X exceeds dataset class count Y. Possible class labels are 0-Y-1\",\n",
    "this means your label files reference class indices not defined in your YAML file.\n",
    "\n",
    "To fix:\n",
    "\n",
    "Update the nc and names fields in pid_config.yaml to include all classes found in your labels.\n",
    "\n",
    "Alternatively, remove or correct label files referencing invalid class indices.\n",
    "\n",
    "The notebook provides code to help you identify and resolve such issues.\n",
    "\n",
    "6. Inference\n",
    "\n",
    "After successful training, you can use the trained model weights for inference on new images.\n",
    "\n",
    "Use the provided inference code cell, specifying the path to your trained weights and input image(s).\n",
    "\n",
    "Best Practices\n",
    "Always ensure your label files and YAML configuration are consistent before training.\n",
    "\n",
    "If you change the number of classes, update both your labels and the YAML config.\n",
    "\n",
    "Regularly back up your dataset, configuration, and trained weights."
